        "title": "Quantum Entanglement: Explained in REALLY SIMPLE Words",
        "description": "Quantum entanglement is a physical resource, like energy, that is possible between quantum systems. When a coin spins on a flat surface, it‚Äôs in a state of superposition between its two faces‚Äîhead and tails. Similarly, electrons in their natural state exist as a superposition of both up and down spin. Only when measured do they give a definite value of up or down, which, in technical terms, is referred to as the ‚Äúcollapse of the wavefunction‚Äù.\n\nIn quantum mechanics, wave function collapse occurs when a wave function, which was initially in a superposition of a few states, reduces to a single state due to interaction with the external world.\n\nWhen a pair of electrons are generated, interact, or share spatial proximity, their spin states can get entangled, which is what scientists call the quantum entanglement of electrons.\n\n\nQuantum entanglement was first recognized by Einstein, Podolsky, Roson and Schrodinger. In this video, we explain quantum entanglement in simple terms so that it becomes accessible to laymen and children who are interested to know about quantum entanglement\n\n\n\nIntro - 0:00\n\nIntroduction to Quantum Mechanics - 0:43\nPrincipal quantum numbers - 1:47\nSpin quantum number and superposition - 3:17\nSchr√∂dinger‚Äôs cat experiment - 4:06\nQuantum entanglement of electrons - 5:23\nApplications of quantum entanglement - 6:36\n\nReferences:\nhttps://www.nist.gov/news-events/news/2019/07/nists-quantum-logic-clock-returns-top-performance\n\nhttps://plato.stanford.edu/entries/qt-entangle/\nhttps://news.mit.edu/2018/light-ancient-quasars-helps-confirm-quantum-entanglement-0820\nhttps://magazine.caltech.edu/post/untangling-entanglement\nhttps://export.arxiv.org/ftp/arxiv/papers/1707/1707.01339.pdf\n\n\n\n#science #animation #QuantumEntanglement\n\n\n\nSUBSCRIBE to get more such science videos! \nhttps://www.youtube.com/channel/UCcN3IuIAR6Fn74FWMQf6lFA?sub_confirmation=1\n\nFollow us on Twitter! \nhttps://twitter.com